import React,{Component} from 'react'
import NAMECARDS from './data/namecards'

class NAMECARDSFrame extends Component{

    render(){
        const {id, name,phone,email,logo}=this.props.nameCard;

        <div>
            <div>
                <h3>{name}</h3>
                <p>{phone}</p>
                <p>{email}</p>
            </div>
            <div>
                <img src={logo}/>
            </div>

        </div>
    }
}
export default NAMECARDSFrame;
